// TodoList.js

import { useState } from "react";


function TodoList() {

    // 상태 
    const [ todos, setTodos ] = useState([{title : "React 복습하기", isDone: false}, 
                                        { title : "일기쓰기", isDone: true}]); 

    // 함수 

    // return () : 화면에 렌더링할 jsx 작성 구문 
    return (
        <div>
            <h1>Todo List</h1>
            <input  />
            <button>추가하기</button>

            <ul>
                {
                    todos.map((todo, index) => {
                        return (
                            <li></li>
                        )
                    })
                }
            </ul>
        </div>
    ); 


}

export default TodoList;
